import styled from 'styled-components'

export const Footers = styled.footer`
 position: relative;
 bottom: 0;
 width: 100%;
 height: 50px;
 p {
     color: #fff;
     text-align: center;
     margin-top: 10px;
 }
`;

export const Forms = styled.form`
 position: relative;
 margin-top: 2vh;
 margin-left:4vh;
 margin-right:4vh;
 bottom: 0px;
 width: 100%;
 height: 100%;

`;
